using System;\nusing System.IO;\nusing System.Text;\n\nclass Program\n{\n    static void Main()\n    {\n        string strPath = "yourfile.log";\n        int count = ReadAndProcessFile(strPath);\n        Console.WriteLine($"Number of lines processed: {count}");\n    }\n\n    static int ReadAndProcessFile(string path)\n    {\n        using (TextReader sr = new StreamReader(path, Encoding.UTF8))\n        {\n            StringBuilder sb = new StringBuilder();\n            int count = 0;\n            int c;\n\n            // Ignore three first lines of log file\n            while ((c = sr.Read()) != -1 && count < 3)\n            {\n                if (c == '\n') count++;\n                else sb.Append((char)c);\n            }\n\n            while ((c = sr.Read()) != -1)\n            {\n                if (c == '\n')\n                {\n                    string line = sb.ToString().Trim();\n                    if (!string.IsNullOrEmpty(line))\n                    {\n                        InsertData(line);\n                    }\n                    sb.Clear();\n                }\n                else\n                {\n                    sb.Append((char)c);\n                }\n            }\n\n            // Check for the last line (if there's no trailing LF)\n            string lastLine = sb.ToString().Trim();\n            if (!string.IsNullOrEmpty(lastLine))\n            {\n                InsertData(lastLine);\n            }\n\n            return count;\n        }\n    }\n\n    static void InsertData(string line)\n    {\n        // Implement your data insertion logic here\n        Console.WriteLine(line);\n    }\n}